CREATE TABLE country (
  id UUID NOT NULL,
   name VARCHAR(255),
   two_char_country_code VARCHAR(2),
   three_char_country_code VARCHAR(3),
   CONSTRAINT pk_country PRIMARY KEY (id)
);
-------------------------------------------
CREATE TABLE city (
  id UUID NOT NULL,
   country_id UUID,
   name VARCHAR(255),
   latitude DOUBLE PRECISION,
   longitude DOUBLE PRECISION,
   northeast_latitude DOUBLE PRECISION,
   northeast_longitude DOUBLE PRECISION,
   southwest_latitude DOUBLE PRECISION,
   southwest_longitude DOUBLE PRECISION,
   CONSTRAINT pk_city PRIMARY KEY (id)
);

ALTER TABLE city ADD CONSTRAINT FK_CITY_ON_COUNTRY FOREIGN KEY (country_id) REFERENCES country (id);
-----------------------------------------------------------------------------------------------------
CREATE TABLE district (
  id UUID NOT NULL,
   city_id UUID,
   name VARCHAR(255),
   latitude DOUBLE PRECISION,
   longitude DOUBLE PRECISION,
   northeast_latitude DOUBLE PRECISION,
   northeast_longitude DOUBLE PRECISION,
   southwest_latitude DOUBLE PRECISION,
   southwest_longitude DOUBLE PRECISION,
   CONSTRAINT pk_district PRIMARY KEY (id)
);

ALTER TABLE district ADD CONSTRAINT FK_DISTRICT_ON_CITY FOREIGN KEY (city_id) REFERENCES city (id);
